import React, { useState, useEffect } from "react";
import Navbar from "../components/Navbar";
import Footer from "../components/Footer";
import "../styles/global.css";
import { FaPlay, FaHistory, FaUser, FaChartLine, FaBrain, FaSmile } from "react-icons/fa";

export default function Dashboard() {
  const [darkMode, setDarkMode] = useState(() => localStorage.getItem("darkMode") === "true");

  useEffect(() => {
    document.body.classList.toggle("dark-mode", darkMode);
    localStorage.setItem("darkMode", darkMode);
  }, [darkMode]);

  return (
    <div className="page-container">
      <Navbar darkMode={darkMode} setDarkMode={setDarkMode} />
      <main className="dashboard-page">

        {/* Greeting Section */}
        <div className="dashboard-header">
          <h1 className="gradient-text">Welcome to HireVisor ðŸ‘‹</h1>
          <p className="dashboard-subtitle">Decode Emotions â€¢ Enhance Hiring</p>
        </div>

        {/* Stats Section */}
        <section className="stats-grid">
          <div className="card glass-card">
            <FaChartLine className="feature-icon" />
            <h3>Total Interviews</h3>
            <p>12</p>
          </div>
          <div className="card glass-card">
            <FaBrain className="feature-icon" />
            <h3>AI Analyses</h3>
            <p>8</p>
          </div>
          <div className="card glass-card">
            <FaSmile className="feature-icon" />
            <h3>Average Emotion Score</h3>
            <p>86%</p>
          </div>
        </section>

        {/* Quick Actions */}
        <section className="quick-actions">
          <button className="primary-btn"><FaPlay /> Start New Interview</button>
          <button className="primary-btn"><FaHistory /> View History</button>
          <button className="primary-btn"><FaUser /> Profile</button>
        </section>

        {/* Recent Activity */}
        <section className="recent-activity">
          <h2>Recent Activity</h2>
          <ul>
            <li>âœ… Completed interview on <b>AI & ML Fundamentals</b></li>
            <li>ðŸ“Š AI emotion analysis generated for <b>Candidate #7</b></li>
